import React from 'react';

const Développement = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Développement</h1>
    </div>
  );
};

export default Développement;
